INSERT INTO `CG_PGMSQL` (`SQLSEQ`, `PJTSEQ`, `PGMSEQ`, `SQLID`, `SQLNM`, `SVRSEQ`, `SVRIDPARAM`, `CRUD`, `RTN_TYPE`, `SQLORD`, `SQLTXT`, `PSQLSEQ`, `ADDDT`, `MODDT`) VALUES
(9, 38, 3, 'delIpG', 'IP', 15, '', 'D', 'RTN_INT', 0, 'DELETE FROM  CMN_IP\nWHERE IP_SEQ = #{IP_SEQ}\n', 0, '20210724220709', NULL),
(10, 38, 3, 'insIpG', 'IP', 15, '', 'C', 'RTN_INT', 0, 'INSERT INTO CMN_IP (\n	PGMTYPE, ALLOW_IP, IP_DESC, ADD_DT, ADD_ID\n) VALUES (	\n	#{PGMTYPE}, #{ALLOW_IP}, #{IP_DESC}, date_format(sysdate(),\'%Y%m%d%H%i%s\'),#{USER.SEQ}   \n)', 0, '20210724220709', NULL),
(11, 38, 3, 'selIpG', 'IP', 15, '', 'R', 'RTN_SELECT_LIST', 0, 'select\n	IP_SEQ, PGMTYPE, ALLOW_IP, IP_DESC, ADD_DT, ADD_ID\n	, MOD_DT, MOD_ID \nfrom CMN_IP\norder by IP_SEQ desc ', 0, '20210724220709', NULL),
(12, 38, 3, 'updIpG', 'IP', 15, '', 'U', 'RTN_INT', 0, 'UPDATE CMN_IP SET\n	PGMTYPE = #{PGMTYPE}, ALLOW_IP = #{ALLOW_IP}, IP_DESC = #{IP_DESC}\n	, MOD_DT = date_format(sysdate(),\'%Y%m%d%H%i%s\') , MOD_ID = #{USER.SEQ}\nWHERE IP_SEQ = #{IP_SEQ}\n', 0, '20210724220709', '20210724220728'),
(13, 38, 4, 'delDtlG', 'DTL', 15, '', 'D', 'RTN_INT', 0, 'delete from CMN_CODED \nwhere PCD = #{PCD} and CD = #{CD}\n', 0, '20210726205354', NULL),
(14, 38, 4, 'delMasG', 'MAS', 15, '', 'D', 'RTN_INT', 0, 'delete from CMN_CODE\nwhere PCD = #{PCD} \n', 0, '20210726205354', NULL),
(15, 38, 4, 'insDtlG', 'DTL', 15, '', 'C', 'RTN_INT', 0, 'insert into CMN_CODED (\n	CD,NM,CDDESC,PCD\n	,ORD,CDVAL,CDVAL2,CDMIN,CDMAX\n	,DATATYPE,EDITYN,FORMATYN,USEYN,DELYN\n	,ADDDT\n) values (\n	#{CD},#{NM},#{CDDESC},#{PCD}\n	,if(#{ORD}=\'\',10,#{ORD}),#{CDVAL},#{CDVAL2},#{CDMIN},#{CDMAX}\n	,#{DATATYPE},#{EDITYN},#{FORMATYN},if(#{USEYN}=\'\',\'Y\',#{USEYN}),if(#{DELYN}=\'\',\'N\',#{DELYN})\n	,date_format(sysdate(),\'%Y%m%d%H%i%s\')\n)', 0, '20210726205354', NULL),
(16, 38, 4, 'insMasG', 'MAS', 15, '', 'C', 'RTN_INT', 0, 'insert into CMN_CODE (\n	PCD,PNM,PCDDESC,ORD,USEYN,DELYN\n	,ADDDT\n) values (\n	#{PCD},#{PNM},#{PCDDESC},if(#{ORD}=\'\',\'10\',#{ORD}),if(#{USEYN}=\'\',\'Y\',#{USEYN}),if(#{DELYN}=\'\',\'N\',#{DELYN})\n	,date_format(sysdate(),\'%Y%m%d%H%i%s\')\n)', 0, '20210726205355', NULL),
(17, 38, 4, 'selDtlG', 'DTL', 15, '', 'R', 'RTN_SELECT_LIST', 0, 'select\n	CODED_SEQ,CD,NM,CDDESC,PCD,ORD\n	,CDVAL,CDVAL2,CDMIN,CDMAX,DATATYPE\n	,EDITYN,FORMATYN,USEYN,DELYN\n	,ADDDT,MODDT\nfrom CMN_CODED\nwhere PCD = #{G2-PCD}\norder by ORD ', 0, '20210726205355', NULL),
(18, 38, 4, 'selMasG', 'MAS', 15, '', 'R', 'RTN_SELECT_LIST', 0, 'select \n	PCD,PNM,PCDDESC,ORD,USEYN\n	,DELYN\n	,ADDDT,MODDT\nfrom \n	CMN_CODE\norder by ORD asc', 0, '20210726205355', NULL),
(19, 38, 4, 'updDtlG', 'DTL', 15, '', 'U', 'RTN_INT', 0, 'update CMN_CODED set\n	CD = #{CD}, NM = #{NM}, CDDESC = #{CDDESC},ORD = #{ORD}, CDVAL = #{CDVAL}, CDVAL2 = #{CDVAL2}\n	, CDMIN = #{CDMIN}, CDMAX = #{CDMAX}, DATATYPE = #{DATATYPE}, EDITYN = #{EDITYN}, FORMATYN = #{FORMATYN}\n	, USEYN = #{USEYN}, DELYN = #{DELYN}, PCD = #{PCD}\n	, MODDT = date_format(sysdate(),\'%Y%m%d%H%i%s\')\nwhere  CODED_SEQ = #{CODED_SEQ}\n', 0, '20210726205355', NULL),
