(79, 38, 15, 'insNoToHoldG', '권한 추가', 15, '', 'U', 'RTN_INT', 0, 'insert into CMN_DEFAULT_AUTH (\n	PGMID, AUTH_ID, ADD_DT, ADD_ID\n) \nselect\n	PGMID, AUTH_ID, date_format(sysdate(),\'%Y%m%d%H%i%s\') as ADD_DT, 0 as ADD_ID\nfrom CMN_AUTH\nWHERE AUTH_SEQ = #{AUTH_SEQ}\n', 0, '20210726205742', NULL),
(80, 38, 15, 'selHoldG', '보유 권한', 15, '', 'R', 'RTN_SELECT_LIST', 0, 'select\n	0 as CHK, a.DA_SEQ, a.PGMID, b.MNU_NM, a.AUTH_ID, c.AUTH_NM, a.ADD_DT, a.ADD_ID\nfrom CMN_DEFAULT_AUTH a\n	left outer join CMN_MNU b on a.PGMID = b.PGMID\n	left outer join CMN_AUTH c on a.PGMID = c.PGMID and a.AUTH_ID = c.AUTH_ID\nwhere 1=1 \n	and case when length(#{G1-PGMID}) > 0 then\n		 a.PGMID like concat(\'%\',#{G1-PGMID},\'%\')\n		else 1 = 1 end\n	and case when length(#{G1-MNU_NM}) > 0 then\n		 b.MNU_NM like concat(\'%\',#{G1-MNU_NM},\'%\')\n		else 1 = 1 end\n	and case when length(#{G1-AUTH_ID}) > 0 then\n		a.AUTH_ID like concat(\'%\',#{G1-AUTH_ID},\'%\')\n		else 1 = 1 end\n	and case when length(#{G1-AUTH_NM}) > 0 then\n		c.AUTH_NM like concat(\'%\',#{G1-AUTH_NM},\'%\')\n		else 1 = 1 end\n', 0, '20210726205742', NULL),
(81, 38, 15, 'selNoG', '미보유 권한', 15, '', 'R', 'RTN_SELECT_LIST', 0, 'select\n	0 as CHK, a.AUTH_SEQ, a.PGMID, c.MNU_NM, a.AUTH_ID, a.AUTH_NM, a.USE_YN, a.ADD_DT, a.MOD_DT\nfrom CMN_AUTH a\n	left outer join CMN_MNU c on a.PGMID = c.PGMID\nwhere not exists(\n	select\n		*\n	from CMN_DEFAULT_AUTH b\n	where a.PGMID = b.PGMID and a.AUTH_ID = b.AUTH_ID\n)\n	and case when length(#{G1-PGMID}) > 0 then\n		a.PGMID like concat(\'%\',#{G1-PGMID},\'%\')\n	else 1 = 1 end\n	and case when length(#{G1-MNU_NM}) > 0 then\n		c.MNU_NM like concat(\'%\',#{G1-MNU_NM},\'%\')\n	else 1 = 1 end\n	and case when length(#{G1-AUTH_ID}) > 0 then\n		a.AUTH_ID like concat(\'%\',#{G1-AUTH_ID},\'%\')\n	else 1 = 1 end\n	and case when length(#{G1-AUTH_NM}) > 0 then\n		a.AUTH_NM like concat(\'%\',#{G1-AUTH_NM},\'%\')\n	else 1 = 1 end\n', 0, '20210726205742', NULL),
(82, 38, 16, 'selF', 'FLUENTD', 14, '', 'R', 'RTN_SELECT_ONE', 10, 'select \n	SEQ, SRC, CONTAINERNM, CONTAINERID, LOG, ifnull(MSG,\'\') as MSG\n	, ADDDT\nfrom\n	FLUENTLOG\nwhere\n	SEQ = #{G2-SEQ}\n', 0, '20210726205816', NULL),
(83, 38, 16, 'selG', 'FLUENTD', 14, '', 'R', 'RTN_SELECT_LIST', 10, 'select \n	SEQ, SRC, CONTAINERNM, CONTAINERID, LOG\n	, ifnull(MSG,\'\') as MSG\n	, DATE_FORMAT(ADDDT,\'%Y.%m.%d %H:%i:%S\') as ADDDT\nfrom\n	FLUENTLOG\nwhere\n	ADDDT >= concat(replace(#{G1-FROM_ADDDT},\'-\',\'\'),\'000000\')\n	and ADDDT <= concat(replace(#{G1-TO_ADDDT},\'-\',\'\'),\'235959\')\n	and case when length(#{G1-SRC}) > 0 then \n		SRC like concat(\'%\',#{G1-SRC},\'%\')\n		else 1 = 1 end\n	and case when length(#{G1-CONTAINERNM}) > 0 then \n		CONTAINERNM like concat(\'%\',#{G1-CONTAINERNM},\'%\')\n		else 1 = 1 end\n	and case when length(#{G1-CONTAINERID}) > 0 then \n		CONTAINERID like concat(\'%\',#{G1-CONTAINERID},\'%\')\n		else 1 = 1 end\n	and case when length(#{G1-LOG}) > 0 then \n		LOG like concat(\'%\',#{G1-LOG},\'%\')\n		else 1 = 1 end\norder by SEQ desc\nlimit #{G1-ROWLIMIT}', 0, '20210726205816', NULL),
